import React, { Fragment } from 'react'

const Comentario = () => {
  return (  
    <Fragment>
      <h1>Comentario</h1>
      <hr />
      <div className="media">
        <img src="https://via.assets.so/img.jpg?w=64&h=64&tc=&bg=grey&t=400" alt="prueba" />
        <div className="media-body">
          <h5 className='mt-0'>Juanito</h5>
          <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit.</p>
        </div>
      </div>
    </Fragment>
  );
}
 
export default Comentario;
